import React from "react";
import { useEffect } from "react";
import { useState } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import {
  Button,
  Modal,
  Form,
  Input,
  Radio,
  Switch,
  Slider,
  Select,
  message,
} from "antd";

const Home = () => {
  const [books, setBooks] = useState([]);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    const fetchAllBooks = async () => {
      try {
        const res = await axios.get("http://localhost:8800/books");
        setBooks(res.data);
      } catch (err) {
        console.log(err);
      }
    };
    fetchAllBooks();
  }, []);

  const handleSubmit = (values) => {
    setLoading(true);
    axios
      .post(`http://localhost:5000/users`, values)
      .then((res) => {
        setLoading(false);
        message.success("User Added Successfully!");
        // history.push("/list");
      })
      .catch((error) => {
        setLoading(false);
        message.error(error);
      });
  };

  const showModal = () => {
    setIsModalOpen(true);
  };

  const handleOk = () => {
    setIsModalOpen(false);
  };
  const handleCancel = () => {
    setIsModalOpen(false);
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:8800/books/${id}`);
      window.location.reload();
    } catch (err) {
      console.log(err);
    }
  };

  return (
    <div>
      <h1>Book Shop</h1>
      <Button onClick={showModal} type="primary">
        Add a Book
      </Button>
      <Modal
        title="Basic Modal"
        open={isModalOpen}
        onOk={handleOk}
        onCancel={handleCancel}
      >
        <Form onFinish={handleSubmit}>
          <Form.Item
            name="username"
            label="UserName"
            rules={[
              {
                required: true,
                message: "Please input your name",
              },
            ]}
          >
            <Input placeholder="Please Enter your username" />
          </Form.Item>
          <Form.Item
            name="email"
            label="Email"
            rules={[
              {
                required: true,
                message: "Please input your correct email",
                type: "email",
              },
            ]}
          >
            <Input placeholder="Please Enter your email" />
          </Form.Item>
          <Form.Item
            name="gender"
            label="Gender"
            rules={[
              {
                required: true,
                message: "Please select your gender",
              },
            ]}
          >
            <Radio.Group>
              <Radio value="male">Male</Radio>
              <Radio value="female">Female</Radio>
              <Radio value="others">Others</Radio>
            </Radio.Group>
          </Form.Item>
          <Form.Item
            name="hobbies"
            label="Hobbies"
            rules={[
              {
                required: true,
                message: "Please select your hobbies",
                type: "array",
              },
            ]}
          >
            <Select mode="multiple" placeholder="Please select you hobbies">
              <Select.Option value="Reading">Reading</Select.Option>
              <Select.Option value="Writing">Writing</Select.Option>
              <Select.Option value="Coding">Coding</Select.Option>
              <Select.Option value="Singing">Singing</Select.Option>
              <Select.Option value="Dancing">Dancing</Select.Option>
            </Select>
          </Form.Item>
          <Form.Item name="review" label="Review">
            <Slider />
          </Form.Item>
          <Form.Item
            name="notificaiton"
            label="Notificaiton"
            valuePropName="checked"
          >
            <Switch />
          </Form.Item>
          <div style={{ textAlign: "right" }}>
            <Button type="primary" loading={loading} htmlType="submit">
              Save
            </Button>{" "}
            <Button type="danger" htmlType="button" onClick={handleCancel}>
              Back
            </Button>
          </div>
        </Form>
      </Modal>
    </div>
  );
};

export default Home;
